                new Review {Overall=3.1f, BeerID=30, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png"},
                new Review {Overall=2.6f, BeerID=30, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Creamy white head stayed on a translucent, heavily carbonated, copper body. Malt & yeast aroma. Medium bodied, finely carbonated, sticky on the palate. Very sweet, malt flavours, floral, mild hops, over ripe fruit & spicy, Typical East European style of over strong , sweet, dark lager."},
                new Review {Overall=2.1f, BeerID=30, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Oh boy. Aroma is sweet, corn, earthy hops, apples, light booze, unpleasant. Appearance is amber, light tan head, clear. Taste is sweet, malt, booze, earthy hop, corn, bready, grainy, not good at all. Mouthfeel is light to medium body, light carbonation, light sweet boozy corn aftertaste. Overall, yikes. Terribly terribly wrong, even for a style I have little to no respect for in the first place."},
                new Review {Overall=2.4f, BeerID=30, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Tried this one after quite liking normal Warka. Bottle. Gold with a white head. Aroma of toast, raisins, apples, burnt toffee. Light to medium bodied, moderate carbonation. The taste is not so great - dried fruit, stewed apples, a burned toffee note that’s presumably the roasted malt, a touch of cqrdboard. But there is some bitterness at the finish and it’s clean enough. Not my sort of thing but by no means poor for its class."},
                new Review {Overall=2f, BeerID=29, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Shared from bottle at puttetjes’. Thanks to ricardopanadeiro. Clear pale golden with white head. Sweet malts, plastic, brown paper bag, dust, anise, sweetener. Moderate sweet and light bitter. Thin body, soft fizzy carbonation."},
                new Review {Overall=2.1f, BeerID=29, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="W aromacie jakies jablkowe estry, troche stechly. Barwa zlota, idealnie klarowne. Piana skapa, utrzymujaca sie. W smaku pelne, troche wodniste, slodowe. Goryczka niska, ale nieprzyjemna, to maja na mysli ludzie ktorzy mowi ze lagery im nie smakuja bo sa gorzkie. Wysycenie srednie. Typowy, kiepski lager."},
                new Review {Overall=2.2f, BeerID=29, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Greetings from Bydgoszcz, Poland to all Beer Geeks and Hopheads around the world!"},
                new Review {Overall=2.3f, BeerID=29, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="słabo. duże wysycenie, znikoma piana. duża slodowosc. nie mój typ"},
                new Review {Overall=2.5f, BeerID=29, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="can @ petrol station shop (somewhere in poland) yellow colour, normal body, average carbonated, typically lager beer notes, nothing special"},
                new Review {Overall=2f, BeerID=29, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Piwo wypite jakiś czas temu. Ocena wystawiona na podstawie retrospekcji, w ramach uzupełnienia profilu."},
                new Review {Overall=1.7f, BeerID=28, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Barwa złota, klarowne, piana niewysoka, nietrwała. W aromacie słodowość, mokry karton, nuda. W smaku wodniste, minimalnie słodowe, lekki mokry karton. Wysycenie wysokie, goryczka niska, niska pijalność. Sikacz jak cholera."},
                new Review {Overall=1.6f, BeerID=28, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Pusto. Słód i nic więcej. Smaku to piwo nie ma w ogóle, wodniste do bólu."},
                new Review {Overall=2f, BeerID=28, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Aromat słaby, głównie kukurydziany i słodowy. Barwa dość jasna, piana raczej słaba. W smaku jest kiepsko, głównie słodowo. Taka nieprzyjemna kwaśność, goryczka niska, wysycenie wysokie. Pełnia niska, zbyt wodniste i kompletnie bez wyrazu. Po prostu słabe piwo."},
                new Review {Overall=1.4f, BeerID=28, Date=DateTime.Now, ImageUrl="/Content/Images/no_image.png",Description="Trudno sie czepiac tego piwa, bo ono smakuje i pachnie praktycznie jak woda... wiec z okazji wczorajszego swieta…"},
